import Carousel from "react-multi-carousel";
import "react-multi-carousel/lib/styles.css";
import colorSharp from "../assets/img/color-sharp.png"; 

export const Achievements = () => {
  const responsive = {
    superLargeDesktop: {
      breakpoint: { max: 4000, min: 3000 },
      items: 3,
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 2,
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 1,
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1,
    },
  };

  return (
    <section className="achievement" id="achievements">
      <div className="container">
        <div className="row">
          <div className="col-12">
            <div className="skill-bx wow zoomIn">
              <h2>Achievements</h2>
              <p>
                Not just what I know, but what I’ve done.<br />
                These reflect impact, growth, and real-world results.
              </p>
              <Carousel
                responsive={responsive}
                infinite
                autoPlay
                autoPlaySpeed={0}
                customTransition="transform 12000ms linear"
                transitionDuration={20000}
                arrows={false}
                draggable={false}
                swipeable={false}
                pauseOnHover={false}
                className="owl-carousel owl-theme skill-slider continuous-carousel"
              >
                {[
                  "Built a custom internal platform adopted by 40+ users",
                  "Maintained 99% uptime across critical financial systems",
                  "Achieved a 30-minute average incident resolution time",
                  "Completed a U.S. Department of Labor Registered Apprenticeship",
                  "Graduated from Tech Elevator’s immersive software bootcamp",
                  "Earned Google UX Design Professional Certification",
                  "Led a React/Next.js client prototype to market-ready delivery",
                  "Mentored multiple cohorts with a 100% program completion rate",
                  "Designed and launched 10+ UX projects with accessibility-first practices",
                  "Built two fully functional, responsive e-commerce websites",
                  "Modernized legacy applications through refactoring and framework upgrades",
                ].map((achievement, index) => (
                  <div className="item glass-tile" key={index}>
                    <h5>{achievement}</h5>
                  </div>
                ))}
              </Carousel>
            </div>
          </div>
        </div>
      </div>
      <img className="background-image-left" src={colorSharp} alt="decorative background" />
    </section>
  );
};
